### 2.2 思路

- 遍历数组,记录当前最小价格 `minPrice` 和 最大利润 `maxProfit`
- 如果当前价格小于 `minPrice`,则更新 `minPrice`
- 如果当前价格减去 `minPrice` 大于 `maxProfit`,则更新 `maxProfit`
- 遍历结束后,返回 `maxProfit`

